import React from "react";
import Navbar from "./Navbar";

function ToDoList() {
  return (
    <div>
      <Navbar />
      <h1>To-Do List</h1>
      <p>Organize and manage your daily tasks efficiently.</p>
    </div>
  );
}

export default ToDoList;
